import java.util.HashMap;
import java.util.HashSet;
import java.util.Set;

public class DiffrentString {
    public static void main(String[] args )
    {
        String s="" +
                "uluaqbxoofvotvfoiexbnprrxptchmlctzgqtkivsilwgwgvpidpvasurraqfkcmxhdapjrlrnkbklwkrvoaziznlpor";
        String t="" +
                "jaetahmxevmkhdfyidhrdeejapfbafwmdqjqszwnwzgclitdhlnkaiyldwkwwzvhyorgbysyjbxsspnjdewjxbhpsvj";
        HashMap<Character,Integer> map=new HashMap<>();
        HashMap<Character,Integer> map1=new HashMap<>();
        for(int i=0;i<s.length();i++)
        {
            if(map.containsKey(s.charAt(i)))
            {
                map.replace(s.charAt(i),map.get(s.charAt(i))+1);

            }

            else
            {
                map.put(s.charAt(i),1);
            }
        }

        for(int i=0;i<t.length();i++)
        {
            if(map1.containsKey(t.charAt(i)))
            {
                map1.replace(t.charAt(i),map1.get(t.charAt(i))+1);

            }

            else
            {
                map1.put(t.charAt(i),1);
            }
        }
        for(int i=0;i<t.length();i++)
        {
            if(map1.get(t.charAt(i))!=map.get(t.charAt(i)))
            {
                System.out.println(t.charAt(i));
                break;
            }

        }

    }
}
